public class SolutionManacher {

	private static boolean overallResult = true;

	public static void main(String[] args) {
		compare(new SolutionManacher().shortestPalindrome("aaaabbaa"), "aabbaaaabbaa");
		compare(new SolutionManacher().shortestPalindrome("bb"), "bb");
		compare(new SolutionManacher().shortestPalindrome("abbabaab"), "baababbabaab");
		compare(new SolutionManacher().shortestPalindrome("a"), "a");
		compare(new SolutionManacher().shortestPalindrome("ca"), "aca");
		compare(new SolutionManacher().shortestPalindrome("ba"), "aba");
		compare(new SolutionManacher().shortestPalindrome("dbbb"), "bbbdbbb");
		compare(new SolutionManacher().shortestPalindrome("bbbd"), "dbbbd");
		compare(new SolutionManacher().shortestPalindrome("abcbacba"), "abcabcbacba");
		compare(new SolutionManacher().shortestPalindrome("dbbbd"), "dbbbd");
		compare(new SolutionManacher().shortestPalindrome("dbbc"), "cbbdbbc");
		compare(new SolutionManacher().shortestPalindrome("aacecaaa"), "aaacecaaa");
		compare(new SolutionManacher().shortestPalindrome("abcd"), "dcbabcd");
		compare(new SolutionManacher().shortestPalindrome("abb"), "bbabb");
		compare(new SolutionManacher().shortestPalindrome("aabba"), "abbaabba");
		compare(new SolutionManacher().shortestPalindrome("abbacd"), "dcabbacd");
		compare(new SolutionManacher().shortestPalindrome("babbbabbaba"), "ababbabbbabbaba");
		compare(new SolutionManacher().shortestPalindrome("aabababababaababaa"), "aababaabababababaababaa");

		compare(new SolutionManacher().shortestPalindrome("aaaaaardaaaaaa"), "aaaaaadraaaaaardaaaaaa");

		long start = System.currentTimeMillis();
		System.out.println(new SolutionManacher().shortestPalindrome(""));
		System.out.println(System.currentTimeMillis() - start);

		System.out.println("Overall = " + overallResult);
	}

	private static void compare(String result, String expected) {
		overallResult &= result.equals(expected);
		System.out.println(result + " == " + expected + " = " + (result.equals(expected)));
	}

	public String shortestPalindrome(String s) {

		if(s.isEmpty()) return s;

		int oddLengthEnd = oddLength(s);
		int eventLengthEnd = evenLength(s);

		int end = Math.max(oddLengthEnd, eventLengthEnd) + 1;
		return new StringBuilder(s.substring(end)).reverse() + s.substring(0, end) + s.substring(end);
	}

	//abbacd
	private int evenLength(String s) {
		int[] dl = new int[s.length()];

		int l = 0;
		int r = -1;

		for(int i = 1; i < s.length(); i++) {

			int k = 1;
			if(i < r) {
				k = (l + r) - i + 1;
			}

			while(i + k - 1 < s.length() && i - k >= 0 && s.charAt(i + k - 1) == s.charAt(i - k)) k++;
			k--;

			if((i - k) < s.length() && i + k - 1 > dl[l]) {
				l = i - k;
				r = i + k - 1;
				dl[l] = r;
			}
		}
		return dl[0];
	}

	//aacecaaa
	private int oddLength(String s) {
		int[] dl = new int[s.length()];

		int l = 0;
		int r = -1;

		for(int i = 1; i < s.length(); i++) {

			int k = 1;
			if(i < r) {
				k = Math.min(l + r - i, r - i) + 1;
			}

			while(i + k < s.length() && i - k >= 0 && s.charAt(i + k) == s.charAt(i - k)) k++;
			k--;

			if(i + k > dl[l]) {
				l = i - k;
				r = i + k;
				dl[l] = r;
			}
		}
		return dl[0];
	}
}
